import React from 'react'
import './Values.css'

function Values({ title, Description, image}) {
  return (
    <div className='values__container container'>
      <img
        src={image}
        alt="IMP"
        className='values__image'
      />

      <h1 className='values__title'>{ title }</h1>
      <h1 className='values__description'>{ Description }</h1>

    </div>
  )
}

export default Values
